// src/pages/SignUp1.tsx
import React, { useState, useRef, useEffect } from "react";
import Webcam from "react-webcam";
import { Box, Button, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";

const SignUp1: React.FC = () => {
    const [frontIC, setFrontIC] = useState<string | null>(null);
    const [backIC, setBackIC] = useState<string | null>(null);
    const [loading, setLoading] = useState(false);

    const webcamRef = useRef<Webcam>(null);
    const navigate = useNavigate();

    // High-quality screenshot
    const captureIC = async () => {
        const imageSrc = webcamRef.current?.getScreenshot();
        if (!imageSrc) return alert("Unable to capture image");

        if (!frontIC) {
            setFrontIC(imageSrc);
            sessionStorage.setItem("ic_front", imageSrc);
        } else if (!backIC) {
            setBackIC(imageSrc);
            sessionStorage.setItem("ic_back", imageSrc);
        }
    };

    // Send images to backend OCR
    const handleNext = async () => {
        if (!frontIC || !backIC) {
            return alert("Please scan both front and back of your IC.");
        }

        try {
            setLoading(true);

            const response = await fetch("http://localhost:8000/api/ocr/extract", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    front: frontIC,
                    back: backIC,
                }),
            });

            const result = await response.json();
            console.log("OCR SERVER RESULT:", result);

            if (!result.success) {
                alert("OCR could not extract details, please retake images.");
                return;
            }

            const extractedData = {
                fullName: result.fullName || "",
                icNumber: result.icNumber || "",
                address: result.address || "",
            };

            sessionStorage.setItem("signupStep2", JSON.stringify(extractedData));

            navigate("/signup-step2", { state: extractedData });

        } catch (err) {
            console.error(err);
            alert("Error during OCR request. Check your server.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <Box textAlign="center" mt={4}>
            <Typography variant="h4" gutterBottom>
                Sign Up â€” Scan Your IC
            </Typography>

            {/* Live Webcam */}
            {!frontIC || !backIC ? (
                <>
                    <Webcam
                        audio={false}
                        ref={webcamRef}
                        screenshotFormat="image/jpeg"
                        width={350}
                        videoConstraints={{ width: 1280, height: 720, facingMode: "user" }}
                        style={{ borderRadius: "10px" }}
                    />

                    <Typography mt={2} color="gray">
                        Make sure the IC is sharp, bright, and fills the frame.
                    </Typography>

                    <Box mt={2}>
                        <Button variant="contained" onClick={captureIC}>
                            {!frontIC ? "Capture Front of IC" : "Capture Back of IC"}
                        </Button>
                    </Box>
                </>
            ) : (
                <>
                    <Box display="flex" justifyContent="center" gap={4} mt={2}>
                        <Box textAlign="center">
                            <Typography>Front IC</Typography>
                            <img src={frontIC} width={160} alt="Front IC" />
                            <Button
                                variant="outlined"
                                onClick={() => {
                                    setFrontIC(null);
                                    sessionStorage.removeItem("ic_front");
                                }}
                                sx={{ mt: 1 }}
                            >
                                Retake
                            </Button>
                        </Box>

                        <Box textAlign="center">
                            <Typography>Back IC</Typography>
                            <img src={backIC} width={160} alt="Back IC" />
                            <Button
                                variant="outlined"
                                onClick={() => {
                                    setBackIC(null);
                                    sessionStorage.removeItem("ic_back");
                                }}
                                sx={{ mt: 1 }}
                            >
                                Retake
                            </Button>
                        </Box>
                    </Box>

                    <Box mt={3}>
                        <Button
                            variant="contained"
                            onClick={handleNext}
                            disabled={loading}
                        >
                            {loading ? "Extracting..." : "Next"}
                        </Button>
                    </Box>
                </>
            )}
        </Box>
    );
};

export default SignUp1;
